          size: 0
          aggs: {
            origins: {
              terms: {field: "passenger.embarkation.keyword", size: 10}
              aggs: {
                originLocation: {
                  top_hits: {
                    size: 1
                    _source: {
                      includes: [
                        passenger.embarkation_coordination
                        passenger.embarkation
                        passenger.embark_country
                        flight.direction
                      ]
                    }
                  }
                }
                destinations: {
                  terms: {field: "passenger.debarkation.keyword", size: 10000}
                  aggs: {
                    destLocation: {
                      top_hits: {
                        size: 1
                        _source: {
                          includes: [
                            passenger.debarkation_coordination
                            passenger.debarkation
                            passenger.debark_country
                          ]
                        }
                      }
                    }
                  }
                }
              }
            }
          }
        }
      }
      format: {property: "aggregations.origins.buckets"}
      transform: [
        {
          type: geopoint
          projection: projection
          fields: [
            originLocation.hits.hits[0]._source.passenger.embarkation_coordination.lon
            originLocation.hits.hits[0]._source.passenger.embarkation_coordination.lat
          ]
        }
      ]
    }
    {
      name: selectedDatum
      on: [
        {trigger: "!selected", remove: true}
        {trigger: "selected", insert: "selected"}
      ]
    }
  ]
  signals: [
    {
      name: selected
      value: null
      on: [
        {events: "@airport:mouseover", update: "datum"}
        {events: "@airport:mouseout", update: "null"}
      ]
    }
  ]
  scales: [
    {
      name: airportSize
      type: linear
      domain: {data: "embarkation", field: "doc_count"}
      range: [
        {signal: "zoom*zoom*0.2+1"}
        {signal: "zoom*zoom*10+1"}
